import React from 'react';
import AppBar from "@mui/material/AppBar";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";
import Search from './Search';
import logo from "./logo.png";
import {BiLogOut} from "react-icons/bi";
import CopyrightOutlinedIcon from '@mui/icons-material/CopyrightOutlined';


function Footer() {
    return (
        <AppBar className='footer' position='static'>

            <Toolbar> 
                {/* <IconButton
                    size="large"
                    edge="start"
                    color='#0000ff'
                    aria-label="menu"
                    sx={{mr:2}}>
                        
                    </IconButton> */}

                   
                
                <Typography className='copyright' variant='h6' component="div" sx={{ flexGrow: 1 }}><h1>Project Management System <opyrightOutlinedIcon/>2022 - All Right Reserved by BlueTeam </h1></Typography>
            </Toolbar>
        </AppBar>
    )
}

export default Footer;
